  const [accountId, setAccountId] = React.useState(null);
  const cookies = new Cookies();

  const {
    data,
    error,
  } = useSWR(
    `https://br1.api.riotgames.com/lol/match/v4/matchlists/by-account/1t_WEO5eianNk29-XPcieo1vBRgxptMhtZCflCcTFG5w?api_key=RGAPI-010fd2a0-a370-44eb-acc2-93947b3a2516`,
    url => fetch(url).then(response => response.json())
  );

  React.useEffect(() => {
    setAccountId(cookies.get('accountId'));
  }, []);
  // console.log(accountId);
